import { Box, Container, Stack } from "@mui/material";

//import { styled } from '@mui/system';
import useMediaQuery from "../hooks/useMediaQuery";

//import { motion } from "framer-motion";

const Header = () => {
  const Media = useMediaQuery("(min-width:1070px)");
  return (
    <div style={{ width:"100%", height:"100vh" }}>
      <Box className="ml-[5%]" width={`${Media ? "90%" : "90%"}`}>
        <div className="w-[100%] h-[100vh] flex justify-center items-center">
            <Stack
              direction={`${Media ? "row" : "column"}`}
              spacing={4}
              width={`${Media ? "100%" : "100%"}`}
              height={`${Media ? "75%" : "80%"}`}
              display={"flex"}
              justifyContent={"space-between"}
              style={{
                backgroundColor: "black",
                padding: `${Media ? "50px" : "20px"}`,
              }}
            >
              <Stack
                width={`${Media ? "900px" : "100%"}`}
                style={{ backgroundColor: "blueviolet" }}
                className="p-[10px]"
                height={`${Media ? "700px " : "70% "}`}
              >
                <h1 className="text-white">hello</h1>
              </Stack>
              <Stack
                width={`${Media ? "600px" : "100%"}`}
                style={{ backgroundColor: "blueviolet" }}
                height={`${Media ? "600px " : "70% "}`}
              >
                <h1 className="text-white">hello</h1>
              </Stack>
            </Stack>
        </div>
        </Box>
      </div>
  );
};

export default Header;
